import React, { Component } from 'react';
import './list.css';
import SideBar from '../sideBar/SideBar.js';
import Header from './../Header/Header.js';
import Content from './../Content/Content.js';



class List extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data: []
        };
    }
    render() {
        return (
            <div width="100%">
                <Header user={this.props.user}/>
               <SideBar/>
               
            </div>
        );
    }
}

export default List;
